import React from 'react';
import styles from './SocialMedia.css';

export const SocialMedia = () => {
  return (
    <div>
        <div className="info">
            <h3>Social Media</h3>
            <i class="fa-brands fa-twitter"></i><a href="">Twitter</a><br />
            <a href="">Youtube</a><br />
            <a href="">Instagram</a><br />
            <a href="">Facebook</a><br />
        </div>
    </div>
  )
}
